function addHorizontalFillLines(polygons, spacing) {
  // Helper: get bounding box of a polygon
  function getBoundingBox(polygon) {
    let minX = Infinity, maxX = -Infinity;
    let minY = Infinity, maxY = -Infinity;
    polygon.forEach(([x, y]) => {
      if (x < minX) minX = x;
      if (x > maxX) maxX = x;
      if (y < minY) minY = y;
      if (y > maxY) maxY = y;
    });
    return { minX, maxX, minY, maxY };
  }

  // Helper: line intersection with polygon edges
  function getIntersections(polygon, yLine) {
    const intersections = [];
    for (let i = 0; i < polygon.length; i++) {
      const p1 = polygon[i];
      const p2 = polygon[(i + 1) % polygon.length];

      if ((p1[1] <= yLine && p2[1] >= yLine) || (p2[1] <= yLine && p1[1] >= yLine)) {
        if (p1[1] !== p2[1]) {
          const t = (yLine - p1[1]) / (p2[1] - p1[1]);
          const xIntersect = p1[0] + t * (p2[0] - p1[0]);
          intersections.push(xIntersect);
        }
      }
    }
    intersections.sort((a, b) => a - b);
    return intersections;
  }

  // For each polygon, generate horizontal lines and append them to polygons array
  polygons.forEach(polygon => {
    const { minY, maxY } = getBoundingBox(polygon);

    for (let y = minY; y <= maxY; y += spacing) {
      const xs = getIntersections(polygon, y);
      for (let i = 0; i < xs.length; i += 2) {
        if (xs[i + 1] !== undefined) {
          // Add line segment as a 2-point polygon
          polygons.push([[xs[i], y], [xs[i + 1], y]]);
        }
      }
    }
  });
}


const closePaths = (lines) =>
{
  return lines.map(line => {
    if (!line.length) return line;
    const first = line[0];
    const last = line[line.length - 1];
    const same =
      Math.abs(first[0] - last[0]) < 0.0001 &&
      Math.abs(first[1] - last[1]) < 0.0001;

    return same ? line : [...line, first];
  });
}
